import React, { Component } from 'react'
import { connect } from 'react-redux'
class Massage extends Component {

    render() {
        return (<div>แพทย์แผนไทย
            {this.data.person}
        </div>)
    }
}


const data = state => {
    return {
        person: state.person,
        service: state.service
    }
}
export default connect(data)(Massage)
